import React, { Component } from "react";
import "materialize-css/dist/css/materialize.min.css";
import M from "materialize-css/dist/js/materialize.min.js";

class BroodjeMenu extends Component {
  state = {};

  componentDidMount() {
    M.AutoInit();
  }

  render() {
    const { broodje } = this.props;
    const broodSoortList = props => (
      <select>
        {" "}
        {props.broodje.broodSoort.map((x, y) => (
          <option key={y}>{x}</option>
        ))}
      </select>
    );
    const menuList = broodje.map(broodje => {
      return <option value="1">{broodje.broodSoort}</option>;
    });
    console.log(broodje);
    return (
      <div className="container">
        <div className="input-field col s12">
          <select defaultValue="">
            <option value="" disabled>
              Broodsoort
            </option>

            <option value="2">Bye</option>
            <option value="3">...</option>
          </select>
        </div>
      </div>
    );
  }
}

export default BroodjeMenu;
